import React, { useState } from "react";

const Feedback = ({ employeeId, onFeedbackSubmit }) => {
  const [feedback, setFeedback] = useState({
    codingStandard: "",
    logicalThinking: "",
    comments: "",
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFeedback({ ...feedback, [name]: value });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    // Pass feedback data back to the parent component (TrainerDashboard)
    onFeedbackSubmit(employeeId, feedback);
  };

  return (
    <div className="modal">
      <div className="modal-content">
        <h2>Provide Feedback for Employee {employeeId}</h2>
        <form onSubmit={handleSubmit}>
          <div className="form-group">
            <label>Coding Standard:</label>
            <input
              type="text"
              name="codingStandard"
              value={feedback.codingStandard}
              onChange={handleChange}
              required
            />
          </div>
          <div className="form-group">
            <label>Logical Thinking:</label>
            <input
              type="text"
              name="logicalThinking"
              value={feedback.logicalThinking}
              onChange={handleChange}
              required
            />
          </div>
          <div className="form-group">
            <label>Additional Comments:</label>
            <textarea
              name="comments"
              value={feedback.comments}
              onChange={handleChange}
            />
          </div>
          <button type="submit" className="submit-btn">
            Submit Feedback
          </button>
        </form>
      </div>
    </div>
  );
};

export default Feedback;
